def str2int(str):
	items = str.strip().split()
	def fetch_int():
		b0 = items.pop(0)
		b1 = items.pop(0)
		b2 = items.pop(0)
		b3 = items.pop(0)
		return int(b0) + (int(b1) << 8) + (int(b2) << 16) + (int(b3) << 24)

	length = fetch_int()
	result = 0
	power = 1
	for i in range(length):
		result += fetch_int()*power
		power *= 10
	return result

