import numpy as np
poly = [1, -B, A, -C]
f = lambda x: (x*x*x - B*x*x + A*x - C)

def binary_search_root(l, r):
	if f(l) == 0: return l
	if f(r) == 0: return r
	if r-l+1 <= 2: return None
	if f(l)*f(r) > 0: return None
	m = (l+r)//2
	if f(m) == 0: return m
	if f(l)*f(m) < 0: return binary_search_root(l, m)
	if f(m)*f(r) < 0: return binary_search_root(m, r)
	assert False
	return None

